import ExpenseItem from './ExpenseItem';

const Expenses = (props) => {
    return (
        <div>
            <ExpenseItem title = {props.title} amount={props.amount} date = {props.date}></ ExpenseItem >
            <ExpenseItem title = {props.title} amount={props.amount} date = {props.date}></ ExpenseItem >
            <ExpenseItem title = {props.title} amount={props.amount} date = {props.date}></ ExpenseItem >
            <ExpenseItem title = {props.title} amount={props.amount} date = {props.date}></ ExpenseItem >
        </div>
    )
}

export default Expenses;
